import React, {Component} from 'react';
import {sendInputValue} from "./api/InputValues";

class Page extends Component {

    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div>
                <p>
                  <label>Авторизация прошла успешно.</label>
                </p>
            </div>
        );
    }    

}
export default Page;
